const ignored_users = [
    {"username1": ['Apples', 'Football', 'Tennis', 'Baseball']},
    {"username2": ['Apples', 'Football', 'Tennis', 'Baseball']}

]


function getRandomNumber(min, max) {
    return Math.floor(Math.random() * (max - min + 1)) + min;
}

function delay(ms) {
  return new Promise(resolve => setTimeout(resolve, ms));
}


function log_content(content) {
    fs.appendFile('storage/logs.txt', content, 'utf8', (err) => {
        if (err) {
            console.error('Error appending to file:', err);
        } else {
            console.log('Content successfully appended to file.');
        }
    });
}




const intervalTime = 600000; 
const err_resp = 'Error resp'; 






client.on('ready', () => {
    console.log(`Logged in as ${client.user.tag}!`);
     


});

const active_users = {};
const first_message_storage = []



client.on('messageCreate', async (message) => {
    if (message.channel.type === 'DM' && message.author.id !== client.user.id) {
      const messageContentLower = message.content.toLowerCase();
      const clientName = message.author.username;


      if (!first_message_storage.includes(clientName)) {
        first_message_storage.push(clientName);

            const startTime = Date.now();
            while (Date.now() - startTime < any_message_delay * 1000) {  
                message.channel.sendTyping();
        
                const waitUntil = Date.now() + 500;
                while (Date.now() < waitUntil) {
                    // Do nothing, just wait
                }
            }

            message.channel.send(any_message)
            .catch(error => {
                if (error.code == 50007) {
                    console.log(`[ALERT] ${clientName} has just decided to block you..`);
                    return
                } else {
                    console.log('Error sending message:', error);
                }
            });     
        }

        if (active_users[clientName]) {
            log_content(`[Trigger] [${new Date().toISOString()}] [Client: ${clientName}] Ignore session: ON`);
            console.log(`[!] User ${clientName} is currently being processed. Ignoring messages.`);
            return;
        }

      for (const trigger in custom_trigger) {
        if (messageContentLower.includes(trigger)) {
          const triggerResponse = custom_trigger[trigger];
  
          try {

            if (!ignored_users[clientName]) {
              ignored_users[clientName] = [];
            }
  
            if (ignored_users[clientName].includes(trigger)) {
              console.log(`[!] Trigger: ${trigger} is already found from user ${clientName}`);
              continue; 
            }
  
            await delay(1500);
  
            if (typeof triggerResponse === 'string') {
              await message.reply(triggerResponse);
            } else if (typeof triggerResponse === 'object') {
              const duration = parseInt(Object.keys(triggerResponse)[0]) * 1000;
              const messages = triggerResponse[Object.keys(triggerResponse)[0]];
  
              for (const msg of messages) {
                if (ignored_users[clientName].includes(msg)) { continue}
                const randomizeDelay = await getRandomNumber(1, 2) * 1000;
            
                if (!ignored_users[clientName].includes(trigger)) {
                  ignored_users[clientName].push(msg); 

                    if (!active_users.hasOwnProperty(clientName)) {
                        active_users[clientName] = true;
                    }
                    
                    await delay(randomizeDelay);
                    await message.channel.sendTyping(); 
                    await delay(duration);
                    await message.channel.send(msg);
                }
            }
            
            if (!ignored_users[clientName].includes(trigger)) {
                ignored_users[clientName].push(trigger); 
                log_content(`[Trigger] [${new Date().toISOString()}] [Client: ${clientName}] Trigger detection: ${trigger}`);

            }
            
            delete active_users[clientName];
            console.log(`[!] User ${clientName} is no longer being processed. Monitoring messages.`);
            log_content(`[Triggrr] [${new Date().toISOString()}] [Client: ${clientName}] Ignore session: OFF`);
            }
            break; 
          } catch (error) {
            console.error("An error occurred while processing the trigger:", error);
          }
        }
      }
    }
  });
  
  



